	  <div>
		<h1>{course}</h1>
		<p>
		  {part1} {exercises1}
		</p>
		<p>
		  {part2} {exercises2}
		</p>
		<p>
		  {part3} {exercises3}
		</p>
		<p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
	  </div>
	)
  }

export default App;
